import React from 'react';

function Header() {
  return (
    <header className="bg-white shadow sticky top-0 z-50">
      <div className="container mx-auto px-4 py-4 flex justify-between items-center">
        {/* Logo / Brand */}
        <div className="text-2xl font-bold text-black">Jobsta</div>

        {/* Navigation Links */}
        <nav className="space-x-6 text-sm font-medium text-black hidden md:block">
          <a href="#get-started" className="hover:text-[#25D366] transition-colors">
            Get Started
</a>
          <a href="#why" className="hover:text-[#25D366] transition-colors">Why Jobsta</a>
          <a href="#testimonials" className="hover:text-[#25D366] transition-colors">Testimonials</a>
          <a href="#getstarted" className="hover:text-[#25D366] transition-colors">Get Started</a>
        </nav>
      </div>
    </header>
  );
}

export default Header;
